import React from 'react';
import $ from "jquery";
import * as AxiosUtils from "../../utils/Axios";

const submitForm = async (e) => {
    e.preventDefault()
    if ($('#email')[0].value === "" || $('#password')[0].value === "") {
        console.log('Input both email & password')
        return
    }
    const post = await AxiosUtils.post('/login', {
        email: $("#email")[0].value,
        password: $("#password")[0].value
    })
    console.log(post)
}

const Button = (props) => {
    return (
        <button type="submit" className="btn btn-primary" style={{color:'green'}} onClick={e => submitForm(e)}>{props.name}</button>
    );
};

export default Button;
